import { Route, Router, Switch } from 'react-router';
import './App.css';
import Navbar from './components/pages/Navbar';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path="/" />
      </Switch>
    </Router>

  );
}

export default App;
